import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/navbar";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Router>
        <Routes>
          <Route exact path="/"  element={<App/>}></Route>
          {/* <Route exact path="/"  element={<App/>}></Route>
          <Route exact path="/"  element={<App/>}></Route>
          <Route exact path="/"  element={<App/>}></Route> */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
